import React, { useState } from 'react';
import axios from 'axios';

function InscriptionForm({ onAddSuccess }) {
  const [candCpf, setCandCpf] = useState('');
  const [vagaCodigo, setVagaCodigo] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post('http://localhost:4000/api/inscricoes', {
        cand_cpf: candCpf,
        pk_vaga_codigo: vagaCodigo
      });
      onAddSuccess();
      console.log('Inscrição adicionada:', response.data);
    } catch (error) {
      console.error('Erro ao adicionar inscrição:', error);
    }
  };

  return (
    <Form onSubmit={handleSubmit}>
      <Form.Group controlId="formCpf">
        <Form.Label>CPF do Candidato:</Form.Label>
        <Form.Control
          type="text"
          placeholder="CPF do candidato"
          name="candCpf"
          value={formData.candCpf}
          onChange={handleChange}
          required
        />
      </Form.Group>
      <Form.Group controlId="formVagaCodigo">
        <Form.Label>Código da Vaga:</Form.Label>
        <Form.Control
          type="text"
          placeholder="Código da vaga"
          name="vagaCodigo"
          value={formData.vagaCodigo}
          onChange={handleChange}
          required
        />
      </Form.Group>
      <Button variant="primary" type="submit">
        Inscrever Candidato
      </Button>
    </Form>
  );
  
}

export default InscriptionForm;
